import React from 'react';
import logo from '../images/logo.svg';

const Footer = () => {
    return (
        <>
            <div>
                <div className="flex flex-col justify-center items-center">
                    <div className=" flex-col">
                        <img src={logo} alt="logooo"/>
                       <p className="text-gray-cf leading-[2rem]">Fast delivery, which is active all over the world, serves with many transportation vehicles.</p>
                    </div>
                    <div></div>
                    <div></div>
                    <div></div>
                </div>
                <div></div>
                <div></div>
            </div>
        </>
    );
};

export default Footer;
